import numpy as np

class RandomSearch:
    def __init__(self, budget=100, dim=10):
        self.budget = budget
        self.dim = dim

    def __call__(self, func):
        f_opt = np.inf
        x_opt = None
        for i in range(self.budget):
            x = np.random.uniform(func.bounds.lb, func.bounds.ub)

            f = func(x)
            if f < f_opt:
                f_opt = f
                x_opt = x
        return f_opt, x_opt

